import React from "react";
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';



const Header = () => (
  <div className="navi">
  <Navbar collapseOnSelect expand="lg">
  <Container>
  <Navbar.Brand href="#home"><Image src="/logo.svg"/></Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#features">Products</Nav.Link>
      <NavDropdown title="Resources" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
      <Nav.Link href="#pricing">Documentation</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
      <Nav.Link href="#pricing">Support</Nav.Link>
      <Nav.Link href="#pricing">Careers</Nav.Link>
    </Nav>
    <Nav>
      <Nav.Link href="#deets" className="nav_signup_btn btn">Create Account</Nav.Link>
      <Nav.Link href="#memes" className="nav_login_btn btn">
       Login
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
  </Container>
</Navbar>
<style jsx>{`
            .navi{
                margin-right:20px;
            }
            .nav_signup_btn{
              width: 150px;
              height: 33px;
              border-radius: 8px;
              border: solid 2px #fff;
              background: 0 0;
              font-size: 14px;
              font-weight: 600;
              font-stretch: normal;
              font-style: normal;
              line-height: normal;
              letter-spacing: normal;
              color: #fff;
            }
            .nav_login_btn{
              width: 83px;
            height: 33px;
            border-radius: 8px;
            background-color: #fff;
            font-size: 14px;
            font-weight: 600;
            font-stretch: normal;
            font-style: normal;
            line-height: normal;
            letter-spacing: normal;
            color: #7d44f0;
            }
        `}</style>


 </div>
);

export default Header;
